The first step is to create a struct to hold your game's state. To begin with, let's create some text, and store a position where we want to render it: use tetra::graphics::{Text, Font, Vec2}; struct GameState { text: Text, position: Vec2,
} impl GameState { fn new() -> GameState { GameState { text: Text::new("Hello, world!", Font::default(), 16.0), position: Vec2::new(0.0, 0.0), } }
}

15.body:
Now that we have some data, we need a way to manipulate it. In Tetra, you do this by implementing the State trait. State has two methods - update , which is where you write your game logic, and draw , which is where you draw things to the screen. By default, the former is called 60 times a second, and the latter is called in sync with your monitor's refresh rate. Let's write some code that draws our text moving across the screen: use tetra::graphics::{self, Color};
use tetra::{State, Context}; impl State for GameState { fn update(&mut self, ctx: &mut Context) -> tetra::Result { self.position.x += 1.0; Ok(()) } fn draw(&mut self, ctx: &mut Context, _dt: f64) -> tetra::Result { graphics::clear(ctx, Color::rgb(0.392, 0.584, 0.929)); graphics::draw(ctx, &self.text, self.position); Ok(()) }
} You might have a few questions after reading that code: What's that Context object that we're passing around? Where does it come from? Why do we return Ok(()) from the methods? To answer these, we'll need to write our program's main function, and actually start our game!

