For this example, we'll use a sprite that I drew - excuse the programmer art: A terrible pixel art knight. Save that image to the root of your project. We can now load it in our GameState constructor: use tetra::graphics::{Texture, Vec2};
use tetra::Context; struct GameState { texture: Texture, position: Vec2,
} impl GameState { fn new(ctx: &mut Context) -> tetra::Result<GameState> { Ok(GameState { texture: Texture::new(ctx, "./player.png")?, position: Vec2::new(0.0, 0.0), }) }
} Note that: We now need to pass the Context into the constructor so that we can pass it to Texture::new - this is so the texture can be loaded into your GPU memory. Texture::new can fail (e.g. if you enter the wrong path), so we need to return tetra::Result<GameState> instead of just GameState . The game logic should pretty much stay the same, although you'll need to amend your draw method to replace self.text with self.texture .

