If you try to run your game now, you'll get a couple of compile errors, due to the changes we made to our constructor: error[E0061]: this function takes 1 parameter but 0 parameters were supplied --> main.rs:39:10 |
10 | fn new(ctx: &mut Context) -> tetra::Result<GameState> { | ----------------------------------------------------- defined here
...
39 | .run(&mut GameState::new()) | ^^^^^^^^^^^^^^^^ expected 1 parameter error[E0277]: the trait bound `std::result::Result<GameState, tetra::error::TetraError>: tetra::State` is not satisfied --> main.rs:39:10 |
39 | .run(&mut GameState::new()) | ^^^ the trait `tetra::State` is not implemented for `std::result::Result<GameState, tetra::error::TetraError>` The obvious solution would be to write something like this: fn main() -> tetra::Result { let mut ctx = ContextBuilder::new("My First Tetra Game", 1280, 720) .build()?; let mut state = GameState::new(&mut ctx)?; ctx.run(&mut state)
} But wait, there's a simpler way! Context provides a method called run_with that will use a closure to initialize your state before running the game: fn main() -> tetra::Result { ContextBuilder::new("My First Tetra Game", 1280, 720) .build()? .run_with(|ctx| GameState::new(ctx))
} And since our constructor's function signature is the same as that of the closure that run_with expects, we can simplify this even further: fn main() -> tetra::Result { ContextBuilder::new("My First Tetra Game", 1280, 720) .build()? .run_with(GameState::new)
} Much nicer! If you run the game now, you should see our little knight running across the screen!

