To get a simple window displayed on screen, the following code can be used: use tetra::graphics::{self, Color};
use tetra::{Context, ContextBuilder, State}; struct GameState; impl State for GameState { fn draw(&mut self, ctx: &mut Context, _dt: f64) -> tetra::Result { // Cornflour blue, as is tradition graphics::clear(ctx, Color::rgb(0.392, 0.584, 0.929)); Ok(()) }
} fn main() -> tetra::Result { ContextBuilder::new("Hello, world!", 1280, 720) .build()? .run(&mut GameState)
} You can see this example in action by running cargo run --example hello_world . The full list of examples is available here .
